import "./App.css";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import MessagesScreen from "./screens/messagesScreen";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/messages" element={MessagesScreen}></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
